import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { Provider } from 'react-redux';
import { store } from './redux/store';

ReactDOM.render(
    <Provider store={store}>
        <div className="App">
            <App />
        </div>
    </Provider>,
    document.getElementById('root')
);
